import ExpenseItem from "./components/ExpenseItem";

function App() {
const expenses = [
  { title: "Car insurance", amount: 294.67, date: new Date(2022, 2, 28)},
  { title: "egeg", amount: 294644.67, date: new Date(2022, 5, 28)},
  { title: "gegegeg", amount: 24.67, date: new Date(2021, 2, 28)},
  { title: "geegeg", amount: 9774.67, date: new Date(2019, 2, 28)}

]

  return (
    <div>
      <h1>Expense Tracker</h1>

      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
